{
  "translationLines": [
    {
      "lineNumber": 56071,
      "originalJapaneseLine": "わずかに名残惜しそうな空気を振り飛ばすように、",
      "translatedEnglishLine": "As if shaking off a faintly lingering feeling of reluctance,"
    },
    {
      "lineNumber": 56072,
      "originalJapaneseLine": "ダークランスは勢いよくマントを翻して、",
      "translatedEnglishLine": "Dark Rance vigorously whipped his cloak,"
    },
    {
      "lineNumber": 56073,
      "originalJapaneseLine": "いずこかへと駆け去っていった。",
      "translatedEnglishLine": "and dashed off to somewhere."
    },
    {
      "lineNumber": 56074,
      "originalJapaneseLine": "「……………………」",
      "translatedEnglishLine": "\"................\""
    },
    {
      "lineNumber": 56075,
      "originalJapaneseLine": "その小さな背中を見送ってから。",
      "translatedEnglishLine": "After seeing off that small back."
    },
    {
      "lineNumber": 56076,
      "originalJapaneseLine": "「チューリップ3号H型、各車とも異常ないわね？",
      "translatedEnglishLine": "\"Tulip No.3 Model H, all vehicles are without issues, right?"
    },
    {
      "lineNumber": 56077,
      "originalJapaneseLine": "　さぁ、出発進こーーーーう！」",
      "translatedEnglishLine": "Now, let's get goingーーー!"
    },
    {
      "lineNumber": 56078,
      "originalJapaneseLine": "重々しい地響きと共に、",
      "translatedEnglishLine": "With a heavy rumbling beneath,"
    },
    {
      "lineNumber": 56079,
      "originalJapaneseLine": "12両の新型戦車が移動し始めた。",
      "translatedEnglishLine": "twelve new model tanks began to move."
    },
    {
      "lineNumber": 56080,
      "originalJapaneseLine": "火星を出て、一行は北上していく。",
      "translatedEnglishLine": "Leaving Mars, the party headed north."
    },
    {
      "lineNumber": 56081,
      "originalJapaneseLine": "「この辺りですね、ランス様…………」",
      "translatedEnglishLine": "\"It's around here, Lord Rance........\""
    },
    {
      "lineNumber": 56082,
      "originalJapaneseLine": "「………………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 56083,
      "originalJapaneseLine": "数日前。",
      "translatedEnglishLine": "A few days earlier."
    },
    {
      "lineNumber": 56084,
      "originalJapaneseLine": "「へぇ、この先ですか……",
      "translatedEnglishLine": "\"Hmm, it's ahead of here..."
    },
    {
      "lineNumber": 56085,
      "originalJapaneseLine": "　最近、妙な通り魔がうろうろしとって……",
      "translatedEnglishLine": "Lately, a strange prowler has been wandering around..."
    },
    {
      "lineNumber": 56086,
      "originalJapaneseLine": "　危ねぇですだ」",
      "translatedEnglishLine": "It's dangerous.\""
    },
    {
      "lineNumber": 56087,
      "originalJapaneseLine": "「通り魔だと？　そんなもんを恐れる俺様か。",
      "translatedEnglishLine": "\"A prowler, you say? Am I someone who fears such a thing?"
    },
    {
      "lineNumber": 56088,
      "originalJapaneseLine": "　ボッコボコの返り討ちにしてくれるわ」",
      "translatedEnglishLine": "I'll make sure to beat it to a pulp in return.\""
    },
    {
      "lineNumber": 56089,
      "originalJapaneseLine": "「へぇ……誰だろうこの人……自信満々だぁ……」",
      "translatedEnglishLine": "\"Hmm... who is this person... so full of confidence...\""
    },
    {
      "lineNumber": 56090,
      "originalJapaneseLine": "「おっ、そうだ。",
      "translatedEnglishLine": "\"Oh, that's right."
    },
    {
      "lineNumber": 56091,
      "originalJapaneseLine": "　叩きのめしてやるから報酬を出せ。",
      "translatedEnglishLine": "Since I'll beat it down, pay me a reward."
    },
    {
      "lineNumber": 56092,
      "originalJapaneseLine": "　金か女の子がいいぞ」",
      "translatedEnglishLine": "Money or girls would be good.\""
    },
    {
      "lineNumber": 56093,
      "originalJapaneseLine": "「ひぇっ！　ななな、なしてそんなことに……」",
      "translatedEnglishLine": "\"Eek! W-w-why would you say such a thing...\""
    },
    {
      "lineNumber": 56094,
      "originalJapaneseLine": "「近くを荒らされて困ってるんだろう？",
      "translatedEnglishLine": "\"You're having trouble because someone is causing havoc nearby, right?"
    },
    {
      "lineNumber": 56095,
      "originalJapaneseLine": "　それを俺様が些細な報酬で",
      "translatedEnglishLine": "That's why I'm saying I'll take care of it for a small reward."
    },
    {
      "lineNumber": 56096,
      "originalJapaneseLine": "　片付けてやろうと言ってるのだ」",
      "translatedEnglishLine": "I'm offering to settle it for you.\""
    },
    {
      "lineNumber": 56097,
      "originalJapaneseLine": "「お、おなごといいますと……ウチの村だと、",
      "translatedEnglishLine": "\"W-w-women, you say... In our village,"
    },
    {
      "lineNumber": 56098,
      "originalJapaneseLine": "　一番若いのは今年43の後家ですが……」",
      "translatedEnglishLine": "the youngest is a 43-year-old widow this year...\""
    },
    {
      "lineNumber": 56099,
      "originalJapaneseLine": "「ええい、限界集落め！",
      "translatedEnglishLine": "\"Ugh, dying settlement!"
    },
    {
      "lineNumber": 56100,
      "originalJapaneseLine": "　そんなのは女の子と言わんのだ！",
      "translatedEnglishLine": "Those aren't girls!"
    },
    {
      "lineNumber": 56101,
      "originalJapaneseLine": "　じゃあ金だ金、老後の蓄えをひっくり返せ！」",
      "translatedEnglishLine": "Then give me money, money! Turn over your retirement savings!\""
    },
    {
      "lineNumber": 56102,
      "originalJapaneseLine": "「そそそ、そんなー」",
      "translatedEnglishLine": "\"N-n-no wayー\""
    },
    {
      "lineNumber": 56103,
      "originalJapaneseLine": "「あれは、村の方々が可哀想では……」",
      "translatedEnglishLine": "\"That's mean to the people of the village...\""
    },
    {
      "lineNumber": 56104,
      "originalJapaneseLine": "「馬鹿者。俺たちがその通り魔とかいうのに遭遇して",
      "translatedEnglishLine": "\"Fool. What if we run into that so-called prowler"
    },
    {
      "lineNumber": 56105,
      "originalJapaneseLine": "　ただ働きになったらどうする」",
      "translatedEnglishLine": "and end up working for free?\""
    },
    {
      "lineNumber": 56106,
      "originalJapaneseLine": "「今さら金には困ってへんやろ。",
      "translatedEnglishLine": "\"You're not short on money at this point, right?"
    },
    {
      "lineNumber": 56107,
      "originalJapaneseLine": "　子供の教育に悪いで」",
      "translatedEnglishLine": "It's bad for the kids' education.\""
    },
    {
      "lineNumber": 56108,
      "originalJapaneseLine": "「ふん、知るか」",
      "translatedEnglishLine": "\"Hmph, I don't care.\""
    },
    {
      "lineNumber": 56109,
      "originalJapaneseLine": "「ランスが馬鹿な事言いそうになるたび、",
      "translatedEnglishLine": "\"Every time Rance is about to say something stupid,"
    },
    {
      "lineNumber": 56110,
      "originalJapaneseLine": "　ナギ達を遠ざけなきゃいけないのよね……」",
      "translatedEnglishLine": "I have to keep Nagi and the others away...\""
    },
    {
      "lineNumber": 56111,
      "originalJapaneseLine": "「がはははは、いじらしいな、内助の功か？",
      "translatedEnglishLine": "\"Gahahahaha, how endearing, is that the power of a good wife?"
    },
    {
      "lineNumber": 56112,
      "originalJapaneseLine": "　10年後が楽しみだな！」",
      "translatedEnglishLine": "I look forward to seeing you in ten years!\""
    },
    {
      "lineNumber": 56113,
      "originalJapaneseLine": "「アンタの為な訳ないでしょ！」",
      "translatedEnglishLine": "\"It's definitely not for your sake!\""
    },
    {
      "lineNumber": 56114,
      "originalJapaneseLine": "「ランス！　向こうで、人が襲われてる！",
      "translatedEnglishLine": "\"Rance! Someone is being attacked over there!"
    },
    {
      "lineNumber": 56115,
      "originalJapaneseLine": "　何かいるわ！」",
      "translatedEnglishLine": "There's something there!\""
    },
    {
      "lineNumber": 56116,
      "originalJapaneseLine": "「おっ、見つかったか！　よし、突撃だ！」",
      "translatedEnglishLine": "\"Oh, we've been spotted! Alright, charge!\""
    },
    {
      "lineNumber": 56117,
      "originalJapaneseLine": "…………",
      "translatedEnglishLine": "........"
    },
    {
      "lineNumber": 56118,
      "originalJapaneseLine": "……",
      "translatedEnglishLine": "..."
    },
    {
      "lineNumber": 56119,
      "originalJapaneseLine": "「んーー……なるほどなぁ……",
      "translatedEnglishLine": "\"Hmm... I see..."
    },
    {
      "lineNumber": 56120,
      "originalJapaneseLine": "　こうすると、この数字までが限界なのか……」",
      "translatedEnglishLine": "So when I do it this way, this number is the limit...\""
    }
  ]
}

